import WebSiteComments from "./WebSiteComments";
import WebsiteCard from "./WebSites/WebsiteCard";

import backBtn from "../../assets/back.svg";

function WebSiteDetail(props) {

  return (
    <div className="col-7 mx-3">
      <button className="btn btn-outline-primary mb-2" onClick={props.onBack}>
        <img src={backBtn} />
        Back
      </button>
      <WebsiteCard webSiteData={props.webSite} onSelect={() => {}}/>
      <hr />
      <WebSiteComments />
    </div>
  );
}

export default WebSiteDetail;
